function ListTodo(props){
    return (
        <div>
        {
            props.todoList.map(
                (todo) => 
                <li>{
                    Object.keys(todo).map(
                        (key) =>
                        <div>
                            {todo[key]}
                        </div>
                    )
                }
                <button onClick = {(e)=>{e.preventDefault();props.delete(todo.title)}}>Delete</button>
                </li>
            )
        }
        </div>
    )
}

export default ListTodo
